@Teslarati @ResidentSponge GM &amp; Chrysler were bailed out (money never repaid), but Tesla was not.

Crucial Tesla investment actually came from Daimler in 2009, from which they did very well.

Tesla received govt energy efficiency loan in 2010, by which time capital markets reopened. Loan was repaid early.

@jgrano305 @WholeMarsBlog Tentative plan is 98 &amp; above starts uploading Friday afternoon next week.

If we see any concerns, uploads will pause while we investigate, so might take a few days before everyone with 98 safety gets beta 10.4.

10.4 improves left turns across fast traffic &amp; stopping for gates.

@wapodavenport According to their own estimates, this tax only covers ~10% of the $3.5 trillion spending bill. 

Where will the other 90% come from? 

The answer is you.

@Papapishu [puff, puff] what if the cure for cancer

[puff, puff] was in the leaf 🍃?? 

🤯🤯

@cybrtrkguy The regulatory process for approval to offer insurance is extremely slow &amp; complex, varying considerably by state. 

Tesla is hoping to offer real-time (based on actual driving history) insurance in Texas next month.

Probably next year before we get approval in New York.

@Gfilche FSD 10 predicts height from video pixels directly, without needing to classify groups of pixels into objects. 

In principle, even if a UFO crashed on the road right in front of you, it would still avoid the debris.

Some work still needed to tune sensitivity.

@anthonyisonline Large incumbent carmakers sell their cars at low to zero true margin. Most of their profit is selling replacement parts to their fleet, of which 70% to 80% are past warranty. 

Like razors &amp; blades.

New car companies lack this advantage. Also lack sales &amp; service infrastructure.

@WholeMarsBlog @truth_tesla @LimitingThe There are vast amounts of iron (and lithium) on Earth, but much less nickel. 

For global industry to scale battery production to ~10 TWh/year, it needs to be mostly iron.

Higher energy density of Nickel only needed for very long range vehicles &amp; aircraft.

@PPathole Booster has 2 pins for lifting &amp; catching, although maybe it’s better to modify grid fins to take more load. 

Something will need to flip out from leeward side of top of ship to do same there. Maybe it’s part of fwd flaps, but prob not.

Diff solutions for diff load paths.

@CathieDWood Tesla makes cars for export in first half of quarter &amp; for local market in second half. 

As publicly disclosed, we are operating under extreme supply chain limitations regarding certain “standard” automotive chips. 

Most problematic by far are Renesas &amp; Bosch.

@WholeMarsBlog @NASASpaceflight @BBCAmos There is a reason no fully reusable orbital rocket has been built – it’s an insanely hard problem. 

Moreover, it must be rapidly &amp; completely reusable (like an airplane). This is the only way to make life multiplanetary.

Efficiencies of scale is why Starship is so large.

@Erdayastronaut @SpaceX That was fun! I was operating on limited sleep &amp; serious back pain, so not at my best. 

It’s awesome that you know so much about how rockets work &amp; their development history. 

Am happy to do another factory tour in a month or two and talk about what’s changed since last time.

@DavidNagySFgang @rocketry_catboy Indeed. Grid fin designs clearly work, but do they maximize payload? Good chance that they do not. 

Something with much more drag to reduce terminal velocity &amp; so reduce landing propellant might have better performance. Not sure. 

Potential future optimization.

@JeffTutorials @WholeMarsBlog That’s arguably a security issue, but  allowing companies to use other payment options, especially for in-app purchases would be fair.

As soon as they allowed that, they would have to lower their fees.

As for the cost of reviewing apps for security, a fixed fee makes sense.

@WholeMarsBlog Actually, I like &amp; use Apple products. 

They are just obviously overcharging with App Store. I mean 30% fees for doing almost zero incremental work is completely unreasonable. 

Epic wouldn’t bother processing their own payments if App Store fees were fair.

@JamesClayton5 @markgurman @tim_cook Cook &amp; I have never spoken or written to each other ever. 

There was a point where I requested to meet with Cook to talk about Apple buying Tesla. There were no conditions of acquisition proposed whatsoever. 

He refused to meet. Tesla was worth about 6% of today’s value.

@WholeMarsBlog This should be clear to anyone who has experienced the FSD beta evolution. 

Self-driving requires solving a major part of real-world AI, so it’s an insanely hard problem, but Tesla is getting it done. 

AI Day will be great.

@skorusARK Cars today are far more complex than Model T, with a global supply chain that is vulnerable to force majeure risk. 

Like Model T, supply chain for battery EVs simply doesn’t exist at massive scale, so must be built in parallel.

Ideas are easy, production is hard.

@Teslarati Large pouch cells undergo significant volumetric changes at high state of charge.

Even so, fire risk is probably less than gasoline cars. There are over 200,000 combustion engine car fires every year in US alone. It’s literally in the name.

https://t.co/uJPlB3IbzQ

@PPathole Most people have no idea Starship exists or how large this beast is!

Body diameter (9m or 30 ft) is bigger than a 747 or A380. Starship thrust &amp; mass are more than double Saturn V moon rocket.

Making life multiplanetary means massive rockets. Got to be done.

@TesLatino We created our own connector, as there was no standard back then &amp; Tesla was only maker of long range electric cars. 

It’s one fairly slim connector for both low &amp; high power charging. 

That said, we’re making our Supercharger network open to other EVs later this year.

@BLKMDL3 @Model3Owners In end, we kept production design almost exactly same as show car. Just some small tweaks here &amp; there to make it slightly better.

No door handles. Car recognizes you &amp; opens door.

Having all four wheels steer is amazing for nimble handling &amp; tight turns!

@Model3Owners To be frank, there is always some chance that Cybertruck will flop, because it is so unlike anything else. 

I don’t care. I love it so much even if others don’t. 

Other trucks look like copies of the same thing, but Cybertruck looks like it was made by aliens from the future.

@TeslaOwnersEBay @Kristennetten @RationalEtienne @EvaFoxU @JohnnaCrider1 @TeslaChillMode @CodingMark @Model3Owners @WholeMarsBlog @AustinTeslaClub I’m trying to set a good example! Population collapse is a much bigger problem than people realize and that’s just for Earth.

Mars has a great need for people, seeing as population is currently zero.

Humans are the custodians of other life on Earth. Let us bring life to Mars!

@28delayslater @karpathy Accurate assessment. 

Btw, Autopilot software is technically led by Ashok, Andrej &amp; Milan, but it’s very much a “knights of the round table” structure. 

There are so many talented engineers on Autopilot/AI team &amp; they decide for themselves what to work on. Kinda like Valve.

@vincent13031925 Mind of car visualization will improve a lot in coming releases. 

Brightness/translucency indicate confidence of neural net in predicting any given object.

Acid test is being able to assess with quick glance at screen if car fully understands environment.

@vonbrauckmann Sanskrit is ancient &amp; amazing, but Archaic Sumerian is generally agreed to be oldest written language. 

As for what was first spoken, it’s hard to say, as no one wrote it down! So much history has been lost due to lack of writing (on something durable).

