@WhatsupFranks @flcnhvy That is the impression that some have 🤣

Traveling to another planet &amp; building a self-sustaining city is not for the faint of heart.

Consider the sad case of Chad (RIP) https://t.co/DhXGi65pKG

@thejackbeyer @MarcusHouse @artzius Center engines on ship will be same as booster engines. This is basically Raptor 2.

Raptor Vacuum would be only variant. Tbd as to whether to commonize R-Vac with Raptor 2 (more thrust), keep same or tighten throat (more Isp). 

Adding 3 more R-Vac to ship with max Isp maybe …

@BLKMDL3 Haha, FSD 9 beta is shipping soon, I swear!

Generalized self-driving is a hard problem, as it requires solving a large part of real-world AI. Didn’t expect it to be so hard, but the difficulty is obvious in retrospect.

Nothing has more degrees of freedom than reality.

@mrgreyev @DirtyTesla @Tesla When we need strange training examples, eg half a car on highway, Tesla sim delivers. 

Also, accidents on Autopilot are becoming rarer, so we need more close call examples.

For safety tests, Autopilot sees dummy far away. Emergency braking only needed for distracted drivers.

@KerbalSpaceP What are we doing wrong at SpaceX? You probably have some good ideas. 

The fundamental optimization for making life multiplanetary &amp; backing up the biosphere is cost per ton to the surface of Mars. 

What system achieves that best?

@michilumin Sorry for any confusion. Dojo is a neural network training computer optimized for video (for self-driving). 

Unless there is a predictable pattern to hashing Scrypt (which we will not attempt to find), it will not be competitive with ASIC-based hashing. 

Potatoes are delicious!

@ajtourville Fiber is wound over rotor at high tension load. Machine to do this was made by Tesla Automation.

Carbon sleeve must put copper rotor in compression or it loosens at low temp due to differential thermal expansion. 

Preload is also helpful for maintaining precise gap to stator.

@p_ferragu Our biggest challenge is supply chain, especially microcontroller chips. Never seen anything like it. 

Fear of running out is causing every company to overorder – like the toilet paper shortage, but at epic scale.

That said, it’s obv not a long-term issue.

@flcnhvy @thatdogegirl @WhatsupFranks @TeslaGong Becoming multiplanetary is one of the greatest filters. Only now, 4.5 billion years after Earth formed, is it possible. 

How long this window to reach Mars remains open is uncertain. Perhaps a long time, perhaps not. 

In case it is the latter, we should act now.

@BTCsessions @TeslaGong @wintonARK Achieving truly decentralized finance – power to the people – is a noble &amp; important goal. 

Layer count depends on projected bandwidth &amp; compute, both rising rapidly, which means single layer network can carry all human transactions in future imo.

For now, Lightning is needed.

@ChainLinkGod @PeterMcCormack Bitcoin is actually highly centralized, with supermajority controlled by handful of big mining (aka hashing) companies. 

A single coal mine in Xinjiang flooded, almost killing miners, and Bitcoin hash rate dropped 35%. Sound “decentralized” to you?

