@garyblack00 @CGrantWSJ @WSJ I find it more helpful to read/follow individual journalists, rather than publications. 

Any given publication is going to have wide range of views, albeit vast majority of stories about any subject are negative, perhaps reflecting innate human biases.

Citizen journalism FTW!

@Amart15416132 @WSJ Your research as a private individual is better than professionals @WSJ! 

Data logs recovered so far show Autopilot was not enabled &amp; this car did not purchase FSD.

Moreover, standard Autopilot would require lane lines to turn on, which this street did not have.

@WholeMarsBlog Essentially, passive Autopilot (car intervenes only when crash probability is high) cuts crashes in half. 

Active Autopilot (car is driving itself) cuts crashes in half again. 

Doesn’t mean there are no crashes, but, on balance, Autopilot is unequivocally safer.

@neuralink @shivon Great review! Neuralink is open to working with neuroscientists to advance the field. 

Short-term goal is addressing brain &amp; spine problems. 

Ultimate goal is symbiosis of human &amp; machine intelligence.

@WholeMarsBlog Sensors are a bitstream and cameras have several orders of magnitude more bits/sec than radar (or lidar). 

Radar must meaningfully increase signal/noise of bitstream to be worth complexity of integrating it. 

As vision processing gets better, it just leaves radar far behind.

@AustinTeslaClub @OwenSparks_ @WholeMarsBlog Good point. 

Next major software rev will do much better with automating wipers, seat heating &amp; defrost. 

Probable seat settings just based on occupant mass distribution should be possible.

@spacex360 Ascent phase, transition to horizontal &amp; control during free fall were good. 

A (relatively) small CH4 leak led to fire on engine 2 &amp; fried part of avionics, causing hard start attempting landing burn in CH4 turbopump. 

This is getting fixed 6 ways to Sunday.

